لولا أن الله تعالى علمنا صيغة الحمد في سورة الفاتحة فقال:{ ٱلْحَمْدُ للَّهِ رَبِّ ٱلْعَالَمِينَ }
ما تعلمنا هذه الصيغة، فتعليم الله لعباده صيغة الحمد في ذاتها نعمة تستحق الحمد، والحمد يستحق الحمد، وهكذا في سلسلة لا تنتهي، ليظل الحق محمودا دائماً، ويظل العبد حامدا دائما
#الشعراوي
